import { v4 as uuidv4 } from 'uuid';

export const initialState = {
  program1: {
    id: uuidv4(),
    name: 'Program 1',
    program_duration: 0,
    duration_unit: '',
    days_per_week: 0,
    main_goal: ''
  }
};
